strings.historia = {
  pageTitle: "Nuestra Historia | Ron de Venezuela",
  titulo: "Nuestra Historia",
  parrafo1: "La historia del ron comenz\xF3 con la llegada de los europeos pues\n  ellos trajeron la ca\xF1a de az\xFAcar que tuvo como primer domicilio\n  la Rep\xFAblica Dominicana y como vecino al Mar Caribe. Esta planta\n  form\xF3 parte del equipaje que acompa\xF1\xF3 a Crist\xF3bal Col\xF3n, en su\n  segundo viaje a Am\xE9rica, en 1493.",
  parrafo2: "En la historia del ron los piratas tambi\xE9n tienen su cap\xEDtulo ya\n  que trajeron a las Antillas una bebida que elaboraban a partir\n  del guarapo de la ca\xF1a de az\xFAcar que llamaron Kill-Devil (mata\n  diablo) o rumbellion, que significa tumulto. No se sabe si el\n  nombre del ron se origin\xF3 de esa palabra o del nombre cient\xEDfico\n  de la ca\xF1a de az\xFAcar: Saccharum Officiarum. El primer documento\n  donde se menciona data del 8 de julio de 1661. Fue emitido por\n  el gobernador de Jamaica y en ese texto se le llamaba\n  simplemente \u201Crum\u201D.",
  parrafo3: "Dave Broom en su libro titulado Rum se\xF1ala que: \u201CAl principio el\n  ron fue una bebida aut\xF3ctona pensada para sirvientes\u201D. En los\n  siglos XVII y XVIII sirvi\xF3 como moneda para comprar a los\n  esclavos que trabajaban en los ca\xF1averales. Hasta finales del\n  siglo XVIII era la bebida preferida de los marinos. En 1693 un\n  dominico estudioso del ron, el padre Jean-Baptiste Labat,\n  perfeccion\xF3 el alambique y utiliz\xF3 el m\xE9todo empleado para el\n  co\xF1ac. El resultado revolucion\xF3 la industria del ron en las\n  colonias francesas.",
  parrafo4: "Los piratas y filibusteros amaban el ron y en las islas se hizo\n  omnipresente. El ponche de ron con especias se transform\xF3 en la\n  bebida preferida de los marinos. Despu\xE9s entr\xF3 a Inglaterra\n  donde se tomaba caliente. Mientras ese ponche se extend\xEDa por\n  Europa, el ron dejaba su pasado poco honorable y ascend\xEDa a\n  otras clases sociales.",
  parrafo5: "Venezuela destil\xF3 su propia historia que suma dos siglos de\n  tradici\xF3n. La ca\xF1a de az\xFAcar lleg\xF3 a Venezuela con los\n  conquistadores espa\xF1oles, quienes la usaban para endulzar y\n  hacer sus guarapos, predecesores del ron.",
  parrafo6: "Hay indicios de que la ca\xF1a de az\xFAcar lleg\xF3 a Venezuela por\n  Coro. En el siglo XVIII, \u201Ccasi todos expresan que era el segundo\n  fruto en estas tierras\u201D, dice Jos\xE9 \xC1ngel Rodr\xEDguez en el libro\n  Nuestra cultura gastron\xF3mica. Y donde hay az\xFAcar, est\xE1n sus\n  bebidas. \u201CDonde germin\xF3 el az\xFAcar se destil\xF3 aguardiente\u201D,\n  recuerda el historiador.",
  parrafo7: "El aguardiente prosper\xF3 en el siglo XVIII en Venezuela porque la\n  colonia espa\xF1ola, para proteger los vinos peninsulares, prohibi\xF3\n  su elaboraci\xF3n. Ese antecedente permiti\xF3 que la historia del ron\n  en el pa\xEDs comenzara temprano, en el siglo XIX. A partir de\n  1880, los altos derechos de importaci\xF3n y los bajos impuestos a\n  la producci\xF3n interna auparon su elaboraci\xF3n. Entonces, los\n  rones de Car\xFApano consiguieron un lugar protag\xF3nico. All\xED no\n  s\xF3lo prosper\xF3 el ron com\xFAn. Tambi\xE9n \u201Cel ron Viejo Car\xFApano\u201D. Los\n  destiladores guardaban el ron en barricas tomadas de vinos\n  europeos a la espera de mejor oportunidad en los precios. Y all\xED\n  se dieron cuenta lo bien que envejec\xEDan.",
  parrafo8: "En el siglo XIX no s\xF3lo hab\xEDa ron en Car\xFApano, estado Sucre;\n  sino tambi\xE9n en Zulia, Miranda, Carabobo, Aragua. Yaracuy,\n  Cojedes, Gu\xE1rico, en los estados andinos y en la regi\xF3n capital\n  de Venezuela. El ron se concentraba en los lugares urbanos,\n  mientras el aguardiente prosperaba en los rurales.",
  parrafo9: "Posteriormente surgieron otros nombres que se han ido\n  consolidando en el pa\xEDs y se proyectan con una imagen s\xF3lida en\n  el exterior porque ofrecen al consumidor algo m\xE1s que calidad,\n  en sus botellas hay historia. Una historia que aliment\xF3 un\n  anecdotario que le dio al ron de Venezuela una trayectoria de\n  m\xE1s de dos siglos de tradici\xF3n."
};
